import React, { useState } from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  ScrollView,
  Switch,
  SafeAreaView,
} from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';
import SafeMitraLogo from '../../components/SafeMitraLogo';
import styles from '../styles-part/DashboardScreenStyles';

const DashboardScreen = () => {
  const navigation = useNavigation();
  const [isAutoAlertEnabled, setIsAutoAlertEnabled] = useState(true);

  return (
    <SafeAreaView style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <View style={styles.logoContainer}>
          <SafeMitraLogo color="#FF3B30" size={30} />
          <Text style={styles.logoText}>SafeMitra</Text>
        </View>
      </View>

      <ScrollView contentContainerStyle={styles.scrollContent}>
        {/* Status Banner */}
        <View style={styles.statusBanner}>
          <Text style={styles.statusTitle}>You are Safe</Text>
          <Text style={styles.statusSubtitle}>Last updated 2 minutes ago</Text>
        </View>

        {/* Status Icon */}
        <View style={styles.statusIconContainer}>
          <View style={styles.shieldIconContainer}>
            <Ionicons name="shield-checkmark" size={50} color="#FF3B30" />
          </View>
          <Text style={styles.statusMessage}>SafeMitra is watching over you</Text>
          <Text style={styles.statusDetail}>Your current location is being monitored</Text>
        </View>

        {/* Quick Action Cards */}
        <View style={styles.cardGrid}>
          {/* SOS Card */}
          <TouchableOpacity style={[styles.card, styles.sosCard]}>
            <Ionicons name="alert-circle" size={32} color="#FFFFFF" />
            <Text style={styles.cardText}>SOS</Text>
          </TouchableOpacity>

          {/* Safe Route Card */}
          <TouchableOpacity style={[styles.card, styles.routeCard]}>
            <Ionicons name="map" size={32} color="#FFFFFF" />
            <Text style={styles.cardText}>Safe Route</Text>
          </TouchableOpacity>

          {/* Guardian Card */}
          <TouchableOpacity style={[styles.card, styles.guardianCard]}>
            <Ionicons name="people" size={32} color="#FFFFFF" />
            <Text style={styles.cardText}>Guardian</Text>
          </TouchableOpacity>
        </View>

        {/* Additional Features Section */}
        <View style={styles.featuresSection}>
          {/* Voice Detection Status */}
          <View style={styles.featureItem}>
            <View style={styles.featureHeader}>
              <Ionicons name="mic" size={24} color="#FF3B30" />
              <Text style={styles.featureTitle}>Hotword Detection</Text>
            </View>
            <Text style={styles.featureStatus}>Listening for your voice</Text>
          </View>

          {/* Auto Alert Toggle */}
          <View style={styles.featureItem}>
            <View style={styles.featureHeader}>
              <Ionicons name="notifications" size={24} color="#FF3B30" />
              <Text style={styles.featureTitle}>Auto Alert</Text>
            </View>
            <View style={styles.toggleContainer}>
              <Switch
                value={isAutoAlertEnabled}
                onValueChange={setIsAutoAlertEnabled}
                trackColor={{ false: '#767577', true: '#FF3B30' }}
                thumbColor={isAutoAlertEnabled ? '#FF3B30' : '#f4f3f4'}
              />
              <Text style={styles.toggleStatus}>
                {isAutoAlertEnabled ? 'Enabled' : 'Disabled'}
              </Text>
            </View>
          </View>
        </View>
      </ScrollView>

      {/* Footer Navigation */}
      <View style={styles.footer}>
        <TouchableOpacity 
          style={[styles.footerIcon, styles.activeFooterIcon]}>
          <Ionicons name="home" size={24} color="#FF3B30" />
          <Text style={styles.footerText}>Home</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.footerIcon}>
          <Ionicons name="notifications" size={24} color="#666666" />
          <Text style={styles.footerText}>Alerts</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.footerIcon}>
          <Ionicons name="settings" size={24} color="#666666" />
          <Text style={styles.footerText}>Settings</Text>
        </TouchableOpacity>
      </View>
    </SafeAreaView>
  );
};

export default DashboardScreen;
